import React, { useState, useEffect } from 'react';
import { useNavigate } from 'react-router-dom';
import {
  Home, LayoutDashboard, FileText, BarChart2, Calculator, Settings, UserCircle, HelpCircle, CloudUpload,
} from 'lucide-react';
import { Card, CardHeader, CardTitle, CardContent } from './card';
import { Button } from './button';
import GreenTrendz from '../assets/img/logo_1.png';

const menuItems = [
  { icon: Home, label: 'Home', path: '/land' },
  { icon: CloudUpload, label: 'Data Upload', path: '/upload' },
  { icon: LayoutDashboard, label: 'Dashboard', path: '/dashboard' },
  { icon: FileText, label: 'Reports', path: '/reports' },
  { icon: BarChart2, label: 'Comparison', path: '/comparison' },
  { icon: Calculator, label: 'CarbonCalculator', path: '/calculator' },
  { icon: Settings, label: 'Settings', path: '/settings' },
  { icon: HelpCircle, label: 'Help & Support', path: '/help' },
  { icon: UserCircle, label: 'Account', path: '/account' },
];

const Dashboard = () => {
  const [activeSection, setActiveSection] = useState('environmental');
  const [data, setData] = useState({ environmentalData: {}, socialData: {}, governanceData: {} });
  const navigate = useNavigate();

  useEffect(() => {
    const fetchData = async () => {
      try {
        const response = await fetch('http://localhost:5000/api/esg-data');
        if (!response.ok) throw new Error('Failed to fetch data');
        const jsonData = await response.json();
        setData(jsonData);
      } catch (error) {
        console.error('Error fetching data:', error);
      }
    };
    fetchData();
  }, []);

  return (
    <div className="flex h-screen bg-gray-100">
      {/* Sidebar */}
      <nav className="w-64 bg-green-700 text-white p-6 fixed h-full shadow-lg">
        <div className="flex items-center space-x-2">
          <img src={GreenTrendz} alt="Logo" className="w-10 h-10" />
          <h5 className="text-xl font-bold">GreenTrendz</h5>
        </div>
        <ul className="mt-6 space-y-4">
          {menuItems.map((item) => (
            <li key={item.path}>
              <a href={item.path} className="flex items-center p-3 rounded-md hover:bg-green-600">
                <item.icon size={20} className="mr-3" />
                {item.label}
              </a>
            </li>
          ))}
        </ul>
      </nav>

      {/* Main Content */}
      <main className="ml-64 p-10 flex-1">
        <h1 className="text-2xl font-bold text-green-900">Dashboard</h1>

        <div className="mt-6 flex space-x-4">
          {['environmental', 'social', 'governance'].map((section) => (
            <Button
              key={section}
              onClick={() => setActiveSection(section)}
              className={`w-1/3 ${activeSection === section ? 'bg-green-700 text-white' : 'bg-white text-green-700 border'}`}
            >
              {section.charAt(0).toUpperCase() + section.slice(1)}
            </Button>
          ))}
        </div>

        <div className="grid grid-cols-2 gap-6 mt-6">
          <Card>
            <CardHeader>
              <CardTitle>Key Metrics</CardTitle>
            </CardHeader>
            <CardContent>
              {Object.entries(data[`${activeSection}Data`]).map(([key, value]) => (
                <div key={key} className="flex justify-between border-b py-2">
                  <span className="text-gray-700">{key.replace(/([A-Z])/g, ' $1')}</span>
                  <span className="font-bold">{value}</span>
                </div>
              ))}
            </CardContent>
          </Card>
        </div>
      </main>
    </div>
  );
};

export default Dashboard;
